(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0db2df"],{"6f81":function(e){e.exports=JSON.parse('{"title":"A Rowdy Place","header":"Poor Dove can\'t seem to take it easy. Can you help her? She\'s lazy, but at least she\'s still working... That\'s in her own words.","chat":[{"chat":[{"char":"Navigator:","dialogue":"Dove, so there you are."},{"char":"Dove:","dialogue":"Yea!"},{"char":"Navigator:","dialogue":"It\'s... 11am in the morning. Are you already on your lunch break?"},{"char":"Dove:","dialogue":"Did you forget that I took a sick day?"},{"char":"Navigator:","dialogue":"You\'re on sick leave for 26 hours in one day..."},{"char":"Dove:","dialogue":"It\'s all your fault! You scared us all when you collapsed from exhaustion last time."},{"char":"Dove:","dialogue":"But no one realized that you fell down on me!"},{"char":"Dove:","dialogue":"You\'re fine, but I got squashed flat..."},{"char":"Navigator:","dialogue":"Hold on! Wasn\'t that quite a while ago?"},{"char":"Dove:","dialogue":"It has become a chronic wound!"},{"char":"Dove:","dialogue":"Couriers don\'t earn much, and still have to make a living in rain or sleet..."},{"char":"Dove:","dialogue":"All we get is a rock-hard loaf of bread... We don\'t even get the chance to sip on a warm beverage..."},{"char":"Dove:","dialogue":"I thought I would be able to relax and chill here, but then this happened..."},{"char":"Dove:","dialogue":"I feel I\'m jinxed..."},{"char":"Navigator:","dialogue":"(Haven\'t you been lying there resting for days already...)"},{"char":"Navigator:","dialogue":"You do know that I\'m not forcing you to work, right?"},{"char":"Navigator:","dialogue":"You aren\'t usually like this. You would retort whenever I said anything. Are you not feeling well?"},{"char":"Dove:","dialogue":"Of course not! I never feel well rested since last time!"},{"char":"Dove:","dialogue":"I need to drag my fatigued body out to fight the Eclipsites... I don\'t know how I survived..."},{"char":"Navigator:","dialogue":"Hold on, last time!? And you didn\'t well rest ever since this place was built?"},{"char":"Navigator:","dialogue":"But I see you sitting there all day."},{"char":"Dove:","dialogue":"That\'s because I can\'t rest properly!"},{"char":"Dove:","dialogue":"You call this place a lounge, but it\'s more like a rec room."},{"char":"Dove:","dialogue":"People are walking here and there every day, bickering or fighting with one another. I just can\'t get a good nap here."},{"char":"Angel:","dialogue":"Given the current energy reserve, we should..."},{"char":"Ms. Blanc:","dialogue":"I should record some of the features on the Colossus and write an intro guide."},{"char":"Vice:","dialogue":"Anyone knows where I put my report?"},{"char":"Dove:","dialogue":"..."},{"char":"Navigator:","dialogue":"..."},{"char":"Navigator:","dialogue":"Okay, I\'ve got your point."},{"char":"Navigator:","dialogue":"I\'ll think of something now."},{"char":"Dove:","dialogue":"What\'s there to think about? Shouldn\'t you just build a rec room?"},{"char":"Navigator:","dialogue":"What? Build a rec room? Why?"},{"char":"Dove:","dialogue":"Once you build a rec room, everyone who wants to play will go there, leaving me alone here so I can take a good afternoon nap—no,\\nI mean, so I can rest."},{"char":"Dove:","dialogue":"A lounge is supposed to be a relaxing place."},{"char":"Dove:","dialogue":"You should build a place for those who have too much energy to get rid of their excess energy."},{"char":"Navigator:","dialogue":"But I have no idea what a rec room is like."},{"char":"Dove:","dialogue":"It\'s okay, I\'ve found you a place right on the Colossus."},{"char":"Navigator:","dialogue":"You only work hard in times like this."},{"char":"Dove:","dialogue":"Let\'s go!"},{"char":"Navigator:","dialogue":"Wait for me! Dove! Why are you suddenly running so fast!"},{"char":"Navigator:","dialogue":"D-Dove, wait up! Huff... Puff..."},{"char":"Dove:","dialogue":"We\'re here!"},{"char":"Dove:","dialogue":"So? What do you think of this place? It\'s not that far either."},{"char":"Navigator:","dialogue":"That\'s because you\'ve been resting the whole time... How did you find this place? Even I don\'t come over here very often..."},{"char":"Dove:","dialogue":"You\'ll be able to find it once you explore the Colossus a few times."},{"char":"Navigator:","dialogue":"But you aren\'t usually that hardworking..."},{"char":"Dove:","dialogue":"Deadlines! Don\'t you know what deadlines are like? Deadlines are the greatest motivators!"},{"char":"Dove:","dialogue":"I\'ll go crazy if I keep spending time with those energetic fools in that room."},{"char":"Navigator:","dialogue":"So, what\'s our next step?"},{"char":"Dove:","dialogue":"Let\'s start moving stuff! Bring all the unused tables, chairs, boxes, and whatever else from the warehouse!"},{"char":"Dove:","dialogue":"Just give those guys a place to hang out!"},{"char":"Navigator:","dialogue":"What? You want me to carry the load?"},{"char":"Dove:","dialogue":"Yeah! Ouch! My ribs were hurt when you crashed on me the last time..."},{"char":"Dove:","dialogue":"Owww! It\'s hurting so badly! I wonder if there are any complications."},{"char":"Dove:","dialogue":"Can I still fly? Will I be kicked out of the Courier Union if I can\'t fly?\\nCan I still idle my time away in the Illumina Federation..."},{"char":"Dove:","dialogue":"NO, I mean, will I still be able to work for them?"},{"char":"Dove:","dialogue":"If I can\'t work anymore, I\'ll end up becoming a beggar in Umbraton."},{"char":"Dove:","dialogue":"I\'ll have to eat breadcrumbs and drink icy cold water... Boohoo...!"},{"char":"Navigator:","dialogue":"St-Stop crying! I\'ll do it! I\'ll do it right away!"},{"char":"Navigator:","dialogue":"Geez, why are there so many boxes here? Do we really need all these tables, chairs, and boxes?"},{"char":"Navigator:","dialogue":"Almost there... Argh... I feel like I can\'t think properly anymore..."},{"char":"Dove:","dialogue":"Come on, you can do it!"},{"char":"Navigator:","dialogue":"W-why are you lying down again? You can even sleep on a box?"},{"char":"Dove:","dialogue":"It\'s all because of my ribs... Hurry up—there\'s a lot more to carry."},{"char":"Navigator:","dialogue":"What? Let me rest for a bit. This is enough stuff anyway. I\'ll continue tomorrow..."},{"char":"Dove:","dialogue":"N-no! It\'s almost night. If you don\'t hurry—"},{"char":"Navigator:","dialogue":"If this place isn\'t ready, those energetic guys will go to the lounge and make it impossible for you to sleep, right?"},{"char":"Dove:","dialogue":"Yes, that\'s right."},{"char":"Navigator:","dialogue":"So, what can I do... Argh... My brain has stopped working..."},{"char":"Dove:","dialogue":"In that case, I\'ll go get someone to help you!"},{"char":"Navigator:","dialogue":"I don\'t think they\'ll come in time."},{"char":"Dove:","dialogue":"Then I\'ll give you a massage!"},{"char":"Navigator:","dialogue":"I thought your ribs were hurting."},{"char":"Dove:","dialogue":"Oh... um... I got better after a little rest—yeah!"},{"char":"Navigator:","dialogue":"That quickly?"},{"char":"Dove:","dialogue":"Yup, I\'m a hardworking person even though I\'m jinxed—I have to ignore the pain in my ribs and contribute to the Colossus..."},{"char":"Dove:","dialogue":"I can\'t do very much compared to you..."},{"char":"Navigator:","dialogue":"(M-my head is hurting again...)"},{"char":"Dove:","dialogue":"I feel so ashamed that I can only do insignificant tasks at the Colossus."},{"char":"Dove:","dialogue":"I\'m working so hard to improve the Colossus by building a rec room, but it isn\'t for myself, it\'s for the entire squad."},{"char":"Dove:","dialogue":"So I can better help Navigator..."},{"char":"Dove:","dialogue":"Although I seem to be resting most of the time and take a lot of sick days, I haven\'t been idle at all!"},{"char":"Dove:","dialogue":"I\'m always thinking of ways to help everyone live a better life in the Colossus and become more like a family."},{"char":"Dove:","dialogue":"If my actions are a nuisance to the team, I\'m sorry. I\'ll reflect on myself..."},{"char":"Navigator:","dialogue":"I-I\'ll think of a solution for you right now! I see, let me try to sense the Colossus!"},{"char":"Navigator:","dialogue":"(Hey, why didn\'t I think about this earlier? It must be because I was complaining the whole time...)"},{"char":"Navigator:","dialogue":"(Yeah, and all these darned boxes—why must I carry them? Why?)"},{"char":"Navigator:","dialogue":"(Her nagging must have affected me...)"},{"char":"Dove:","dialogue":"Amazing! I wouldn\'t have gotten so tired if we knew about this earlier on! You\'re almost there!"},{"char":"Dove:","dialogue":"It\'s almost done! Keep it up, Navigator!"},{"char":"Navigator:","dialogue":"Ah... I feel like my brain has shut down after building this room..."},{"char":"Dove:","dialogue":"I didn\'t know it was this convenient! I wouldn\'t have gotten so tired if we did this from the beginning."},{"char":"Navigator:","dialogue":"You\'re tired? I\'m the only one who\'s strength is exhausted here!"},{"char":"Dove:","dialogue":"It\'s very tiring to give commands, you know. Enough chit chat, I\'m going to take a break now."},{"char":"Navigator:","dialogue":"You...!"},{"char":"Dove:","dialogue":"Bye! Oh, and don\'t forget to give me paid leave!"}],"branch":[]}]}')}}]);
